import {
	Head,
	HomeProfile,
	ProfileAvatar,
	Avatar,
} from "../../container/style";
import classnames from "classnames";

interface IHeader {
	noHead: boolean;
}
const Header: React.FC<IHeader> = () => {
	return (
		<Head color="rgb(1, 169, 244)">
			<HomeProfile>Restaurant Reservation</HomeProfile>
			<ProfileAvatar>
				<Avatar>DS</Avatar>
			</ProfileAvatar>
		</Head>
	);
};
export default Header;
